import React from 'react';
import Service from "../../repository/Repository";
import {useLocation} from "react-router-dom";

const SearchResultBook = ({ data }) => {
    const location=useLocation()
    const mydata=location.state
    const onFormSubmit =async (e) => {
        e.preventDefault();
        console.log(mydata)
    }
    return (
        <div>
            <div style={{ maxWidth: '600px', margin: '0 auto', padding: '20px', backgroundColor: '#f5f5f5', borderRadius: '10px', boxShadow: '0 2px 5px rgba(0, 0, 0, 0.3)' }}>
                <h2 style={{ fontSize: '32px', marginBottom: '10px', color: '#333' }}>{mydata.label}</h2>
                <p style={{ fontSize: '16px', lineHeight: '1.5', color: '#666', marginTop: '0', marginBottom: '10px' }}>Country: {mydata.country}</p>
                <p style={{ fontSize: '16px', lineHeight: '1.5', color: '#666', marginTop: '0', marginBottom: '10px' }}>Release Date: {mydata.releaseDate}</p>
                <p style={{ fontSize: '16px', lineHeight: '1.5', color: '#666', marginTop: '0', marginBottom: '10px' }}>Language: {mydata.language}</p>
                <p style={{ fontSize: '16px', lineHeight: '1.5', color: '#666', marginTop: '0', marginBottom: '0' }}>Abstract: {mydata.abstract}</p>
            </div>
        </div>
    );
};

export default SearchResultBook;
